INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "キャル", 0, 1, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 7001, "2030/12/17 14:59:59", 7, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 106001, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "コッコロ", 0, 1, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 7002, "2030/12/17 14:59:59", 7, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105901, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "ペコリーヌ", 0, 1, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 7003, "2030/12/17 14:59:59", 7, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "ペコリーヌ", 0, 1, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 10001, "2030/12/17 14:59:59", 10, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "キャル", 0, 1, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 10002, "2030/12/17 14:59:59", 10, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 106001, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "コッコロ", 0, 1, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 10003, "2030/12/17 14:59:59", 10, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105901, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "シェフィ", 2104010, 1, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 10004, "2030/12/17 14:59:59", 10, 1, 0, "2015/12/17 15:00:00", 2, 0.0, 106401, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-416.5, "ペコリーヌ", 0, 1, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 12001, "2030/12/17 14:59:59", 12, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "キャル", 0, 1, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 13001, "2030/12/17 14:59:59", 13, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 106001, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "コッコロ", 0, 1, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 13002, "2030/12/17 14:59:59", 13, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105901, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "シェフィ", 2104010, 1, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 13003, "2030/12/17 14:59:59", 13, 1, 0, "2015/12/17 15:00:00", 2, 0.0, 106401, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "ペコリーヌ", 0, 1, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 13004, "2030/12/17 14:59:59", 13, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "コッコロ", 0, 1, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 14001, "2030/12/17 14:59:59", 14, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105901, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "シェフィ", 2104010, 1, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 14002, "2030/12/17 14:59:59", 14, 1, 0, "2015/12/17 15:00:00", 2, 0.0, 106401, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "ペコリーヌ", 0, 1, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 14003, "2030/12/17 14:59:59", 14, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "キャル", 0, 1, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 14004, "2030/12/17 14:59:59", 14, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 106001, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-470.0, "コッコロ", 0, 1, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 15001, "2030/12/17 14:59:59", 15, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105901, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "シェフィ", 2104010, 1, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 16001, "2030/12/17 14:59:59", 16, 1, 0, "2015/12/17 15:00:00", 2, 0.0, 106401, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "ペコリーヌ", 0, 1, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 16002, "2030/12/17 14:59:59", 16, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "キャル", 0, 1, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 16003, "2030/12/17 14:59:59", 16, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 106001, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "コッコロ", 0, 1, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 16004, "2030/12/17 14:59:59", 16, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105901, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "コッコロ", 0, 1, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 17002, "2030/12/17 14:59:59", 17, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105901, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "キャル", 0, 1, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 17004, "2030/12/17 14:59:59", 25, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 106001, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "コッコロ", 0, 1, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 17005, "2030/12/17 14:59:59", 25, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105901, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "シェフィ", 2104010, 1, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 17006, "2030/12/17 14:59:59", 25, 1, 0, "2015/12/17 15:00:00", 2, 0.0, 106401, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "ペコリーヌ", 0, 1, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 17007, "2030/12/17 14:59:59", 25, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "カリン", 0, 1, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 18001, "2030/12/17 14:59:59", 18, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 190801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "カリン", 0, 1, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 18002, "2030/12/17 14:59:59", 18, 2, 0, "2015/12/17 15:00:00", 1, 0.0, 190801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-470.0, "カリン", 0, 1, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 19001, "2030/12/17 14:59:59", 19, 3, 0, "2015/12/17 15:00:00", 1, 0.0, 190801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-470.0, "カリン", 0, 1, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 19002, "2030/12/17 14:59:59", 19, 4, 0, "2015/12/17 15:00:00", 1, 0.0, 190801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-470.0, "カリン", 0, 1, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 20001, "2030/12/17 14:59:59", 20, 5, 0, "2015/12/17 15:00:00", 1, 0.0, 190801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-470.0, "カリン", 0, 1, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 20002, "2030/12/17 14:59:59", 20, 6, 0, "2015/12/17 15:00:00", 1, 0.0, 190801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "キャル", 0, 1, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 21001, "2030/12/17 14:59:59", 21, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 106001, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "コッコロ", 0, 1, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 21002, "2030/12/17 14:59:59", 21, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105901, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "シェフィ", 2104010, 1, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 21003, "2030/12/17 14:59:59", 21, 1, 0, "2015/12/17 15:00:00", 2, 0.0, 106401, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "ペコリーヌ", 0, 1, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 21004, "2030/12/17 14:59:59", 21, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-430.0, "カリン", 0, 1, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 22001, "2030/12/17 14:59:59", 22, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 190801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-430.0, "カリン", 0, 1, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 22002, "2030/12/17 14:59:59", 22, 2, 0, "2015/12/17 15:00:00", 1, 0.0, 190801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-430.0, "カリン", 0, 1, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 23001, "2030/12/17 14:59:59", 23, 3, 0, "2015/12/17 15:00:00", 1, 0.0, 190801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-430.0, "カリン", 0, 1, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 23002, "2030/12/17 14:59:59", 23, 4, 0, "2015/12/17 15:00:00", 1, 0.0, 190801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, "エリコ（バレンタイン）", 0, 2, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 24001, "2030/12/17 14:59:59", 24, 1, 10011, "2019/01/31 12:00:00", 1, 4.08, 109001, 8.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, "エリコ（バレンタイン）", 0, 2, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 24002, "2030/12/17 14:59:59", 24, 2, 10011, "2019/01/31 12:00:00", 1, 5.0, 109001, 8.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, "エリコ（バレンタイン）", 0, 2, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 24003, "2030/12/17 14:59:59", 24, 3, 10011, "2019/01/31 12:00:00", 1, 10.11, 109001, 8.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, "エリコ（バレンタイン）", 0, 2, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 24004, "2030/12/17 14:59:59", 24, 4, 10011, "2019/01/31 12:00:00", 1, 4.0, 109001, 8.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, "エリコ（バレンタイン）", 0, 2, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 24005, "2030/12/17 14:59:59", 24, 5, 10011, "2019/01/31 12:00:00", 1, 6.0, 109001, 8.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "エリコ（バレンタイン）", 0, 1, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 24006, "2030/12/17 14:59:59", 24, 6, 10011, "2019/01/31 12:00:00", 1, 0.0, 109002, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "エリコ（バレンタイン）", 0, 1, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 24007, "2030/12/17 14:59:59", 24, 7, 10011, "2019/01/31 12:00:00", 1, 0.0, 109002, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "エリコ（バレンタイン）", 0, 1, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 24008, "2030/12/17 14:59:59", 24, 8, 10011, "2019/01/31 12:00:00", 1, 0.0, 109002, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "エリコ（バレンタイン）", 0, 1, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 24009, "2030/12/17 14:59:59", 24, 9, 10011, "2019/01/31 12:00:00", 1, 0.0, 109002, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "エリコ（バレンタイン）", 0, 1, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 24010, "2030/12/17 14:59:59", 24, 10, 10011, "2019/01/31 12:00:00", 1, 0.0, 109002, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, "シズル（バレンタイン）", 0, 2, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 24011, "2030/12/17 14:59:59", 24, 1, 10011, "2019/01/31 12:00:00", 1, 2.12, 109101, 8.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, "シズル（バレンタイン）", 0, 2, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 24012, "2030/12/17 14:59:59", 24, 2, 10011, "2019/01/31 12:00:00", 5, 4.19, 109101, 8.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, "シズル（バレンタイン）", 0, 4, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 24013, "2030/12/17 14:59:59", 24, 3, 10011, "2019/01/31 12:00:00", 2, 2.3, 109101, 8.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "シズル（バレンタイン）", 0, 1, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 24014, "2030/12/17 14:59:59", 24, 4, 10011, "2019/01/31 12:00:00", 1, 0.0, 109102, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, "シズル（バレンタイン）", 0, 2, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 24015, "2030/12/17 14:59:59", 24, 5, 10011, "2019/01/31 12:00:00", 5, 5.23, 109101, 8.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "シズル（バレンタイン）", 0, 1, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 24016, "2030/12/17 14:59:59", 24, 6, 10011, "2019/01/31 12:00:00", 1, 0.0, 109102, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, "シズル（バレンタイン）", 0, 2, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 24017, "2030/12/17 14:59:59", 24, 7, 10011, "2019/01/31 12:00:00", 1, 5.01, 109101, 8.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "シズル（バレンタイン）", 0, 1, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 24018, "2030/12/17 14:59:59", 24, 8, 10011, "2019/01/31 12:00:00", 1, 0.0, 109102, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "シズル（バレンタイン）", 0, 1, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 24019, "2030/12/17 14:59:59", 24, 9, 10011, "2019/01/31 12:00:00", 1, 0.0, 109102, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "シズル（バレンタイン）", 0, 1, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 24020, "2030/12/17 14:59:59", 24, 10, 10011, "2019/01/31 12:00:00", 1, 0.0, 109102, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "シェフィ", 2104010, 1, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 26001, "2030/12/17 14:59:59", 26, 1, 0, "2015/12/17 15:00:00", 2, 0.0, 106401, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "ペコリーヌ", 0, 1, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 26002, "2030/12/17 14:59:59", 26, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "キャル", 0, 1, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 26003, "2030/12/17 14:59:59", 26, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 106001, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "コッコロ", 0, 1, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 26004, "2030/12/17 14:59:59", 26, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105901, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "シェフィ", 2104010, 1, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", 27001, "2030/12/17 14:59:59", 27, 1, 0, "2015/12/17 15:00:00", 2, 0.0, 106401, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "ペコリーヌ", 0, 1, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 27002, "2030/12/17 14:59:59", 27, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "キャル", 0, 1, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", 27003, "2030/12/17 14:59:59", 27, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 106001, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "コッコロ", 0, 1, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", 27004, "2030/12/17 14:59:59", 27, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105901, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "カリン", 0, 1, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", 28001, "2030/12/17 14:59:59", 28, 1, 0, "2019/09/24 15:00:00", 1, 0.0, 190801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "カリン", 0, 1, "ギルド管理協会です\nフレンドに関しては\nこちらでご確認ください", 28002, "2030/12/17 14:59:59", 28, 2, 0, "2019/09/24 15:00:00", 1, 0.0, 190801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-409.0, "カリン", 0, 1, "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！", 29001, "2030/12/17 14:59:59", 29, 3, 0, "2019/09/24 15:00:00", 1, 0.0, 190801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-409.0, "カリン", 0, 1, "こちらの一覧で\nフレンドのプロフィールを\n確認できますよ", 29002, "2030/12/17 14:59:59", 29, 4, 0, "2019/09/24 15:00:00", 1, 0.0, 190801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-409.0, "カリン", 0, 1, "フレンド管理は\nこちらになります\n新しいフレンドとの出会いを\n楽しんでくださいね！", 30001, "2030/12/17 14:59:59", 30, 5, 0, "2019/09/24 15:00:00", 1, 0.0, 190801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-409.0, "カリン", 0, 1, "フレンドの申請や\n承認ができますよ\nどうぞ、良き交流を！", 30002, "2030/12/17 14:59:59", 30, 6, 0, "2019/09/24 15:00:00", 1, 0.0, 190801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-409.0, "カリン", 0, 1, "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！", 31001, "2030/12/17 14:59:59", 31, 7, 0, "2019/10/31 12:00:00", 1, 0.0, 190801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-409.0, "カリン", 0, 1, "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね", 31002, "2030/12/17 14:59:59", 31, 8, 0, "2019/10/31 12:00:00", 1, 0.0, 190801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-409.0, "カリン", 0, 1, "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！", 32001, "2020/01/04 4:59:59", 32, 1, 0, "2019/12/20 5:00:00", 1, 0.0, 190801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-409.0, "カリン", 0, 1, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 32002, "2020/01/04 4:59:59", 32, 2, 0, "2019/12/20 5:00:00", 1, 0.0, 190801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-409.0, "カリン", 0, 1, "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！", 33001, "2020/01/04 4:59:59", 33, 3, 0, "2019/12/20 5:00:00", 1, 0.0, 190801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-409.0, "カリン", 0, 1, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 33002, "2020/01/04 4:59:59", 33, 4, 0, "2019/12/20 5:00:00", 1, 0.0, 190801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-409.0, "カリン", 0, 1, "お疲れ様でした！\nミッションの報酬の受け取りは\nこちらからできますよ！", 34001, "2020/01/10 11:59:59", 34, 5, 0, "2020/01/04 5:00:00", 1, 0.0, 190801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-409.0, "カリン", 0, 1, "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！", 34002, "2020/01/10 11:59:59", 34, 6, 0, "2020/01/04 5:00:00", 1, 0.0, 190801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-458.0, "ペコリーヌ", 0, 2, "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪", 38001, "2030/12/17 14:59:59", 38, 1, 0, "2015/12/17 15:00:00", 1, 5.3, 105801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-458.0, "ペコリーヌ", 0, 2, "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆", 38002, "2030/12/17 14:59:59", 38, 2, 0, "2015/12/17 15:00:00", 1, 6.5, 105801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (9999.0, "ペコリーヌ", 0, 3, "", 39005, "2020/04/08 23:59:59", 39, 0, 0, "2020/04/01", 3, 0.0, 105801, 9999.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-430.0, "カリン", 0, 1, "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪", 40001, "2030/12/17 14:59:59", 40, 2, 0, "2015/12/17 15:00:00", 1, 0.0, 190801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "シェフィ", 2104010, 1, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", 41001, "2030/12/17 14:59:59", 41, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 106401, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "ペコリーヌ", 0, 1, "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", 41002, "2030/12/17 14:59:59", 41, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "キャル", 0, 1, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", 41003, "2030/12/17 14:59:59", 41, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 106001, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "コッコロ", 0, 1, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", 41004, "2030/12/17 14:59:59", 41, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105901, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-416.5, "コッコロ", 0, 1, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", 42001, "2030/12/17 14:59:59", 42, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105901, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-416.5, "シェフィ", 2104010, 1, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", 42002, "2030/12/17 14:59:59", 42, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 106401, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-416.5, "ペコリーヌ", 0, 1, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", 42003, "2030/12/17 14:59:59", 42, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-416.5, "キャル", 0, 1, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", 42004, "2030/12/17 14:59:59", 42, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 106001, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "ペコリーヌ", 0, 1, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", 43001, "2030/12/17 14:59:59", 43, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105801, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "コッコロ", 0, 1, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 43002, "2030/12/17 14:59:59", 43, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 105901, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, "キャル", 0, 1, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 43003, "2030/12/17 14:59:59", 43, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 106001, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-416.5, "アメス", 0, 1, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 43004, "2030/12/17 14:59:59", 44, 1, 0, "2015/12/17 15:00:00", 1, 0.0, 123001, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-416.5, "アメス", 0, 1, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 43005, "2030/12/17 14:59:59", 44, 2, 0, "2015/12/17 15:00:00", 1, 0.0, 123001, 0.0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-416.5, "アメス", 0, 2, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 43006, "2030/12/17 14:59:59", 45, 3, 0, "2015/12/17 15:00:00", 1, 5.79, 123001, 0.0);
